const Photos = () => {

return (

<React.Fragment>

<Link to="/O-Kia-Band-2016">
<section className="Photo"> 
		<div className="g-row">
			<div className="g-30">
				<img className="Bandphoto" src={require("../component/img/band10.jpg")}/>
